import React,{useState} from "react";
import "./App.css";
import axios from "axios";

function App() {
  function test() {
    axios.get("http://localhost:3000/questions").then((res) => console.log(res));
  }

  const [text,setText] = useState([]);

  const headers = {
    "Content-Type": "application/json",
  };

  var data = {
    question: "test2",
  };

  function handleClick(e) {
    e.preventDefault();
    axios
      .post("http://localhost:3000/questions", data, {
        headers: headers,
      })
      .then((res) => console.log(res))
      .catch(err => console.log(err));
  }


  function handleQuestion(e){
    e.preventDefault();
    var pom = Math.floor(Math.random() * 3) + 1;
    axios
      .get("http://localhost:3000/questions/" + pom)
      .then((res) => setQuestion(res))
      .catch(err => console.log(err));
    console.log(text);
  }


  return (
    <div className="App">
      <header className="App-header">
        {test()}
        <ul>
          {text.map(item => <li key={item}>{item}</li>)}
        </ul>
        <a href="#" onClick={handleClick}>
          Kliknij mnie
        </a>
        <a href="#" onClick={handleQuestion}>
          Kliknij mnieee
        </a>
      </header>
    </div>
  );
}

export default App;
